import React from 'react'
import './event.css';

const Event = (evento) => {
  console.log(evento.lugar);
  return (
    <div>
        <div className='website__eventos-contentiner-evento'>
            <h2>{evento.nombre}</h2>
            <p><strong>Fecha:</strong> {evento.fecha}</p>
            <p><strong>Lugar:</strong> {evento.lugar}</p>
        </div>
    </div>
  )
}

export default Event
